import React from 'react';
import SignedInFooter from '../components/Footer/SignedInFooter';
import SignedOutFooter from '../components/Footer/SignedOutFooter';

class Footer extends React.Component {
    render() {
        if(this.props.signedIn){
            return (
                <div className="footer">
                    <SignedInFooter />
                </div>   
            )
        }else {
            return (
                <div className="footer">
                    <SignedOutFooter  toggleForm={this.props.toggleForm}/>
                </div>
            )
        }
    }
}

export default Footer;
